            ['id' => 15, 'context' => 'faq', 'content' => 'Van okoslabda a kínálatban? Igen, a webshopban elérhető az adidas Smart Ball, amely egy beépített szenzorral ellátott intelligens focilabda. Ez a méret 5-ös labda bluetooth kapcsolaton keresztül összekapcsolható mobilalkalmazással, amellyel a lövések sebességét, pörgését és irányát is mérheted. Az okoslabda ideális technikai fejlesztéshez, edzőknek és játékosoknak is. Az ára jelenleg 1220 lej.', 'embedding' => '[-0.006960251,0.03411706,-0.03664806,-0.013488379,0.026626946,-0.035063613,0.01020631,0.0058387914,0.052183878,-0.035187077,0.008055989,-0.059509374,-0.014033676,0.0027650665,0.038376547,-0.005483834,-0.05321274,-0.032758962,-0.018828172,-0.015525526,0.0045321365,0.028705247,0.028581783,-0.04142198,-0.003276925,-0.037409417,0.014434933,-0.046545714,-0.014846478,0.017552383,-0.02660637,-0.019177986,-0.029013906,-0.04448799,-0.03732711,0.0015407207,0.020813877,-0.0066515924,0.024528068,-0.06650563,-0.004166891,0.037718076,0.006600149,0.009738178,0.012747599,-0.009552983,-0.020145116,-0.020206848,-0.034878418,0.015350619,-0.031709526,0.07346074,-0.021503214,0.04708072,0.0036601762,0.016749872,-0.011975952,0.07683541,0.068028346,0.050373077,-0.051155016,0.037100762,-0.012377209,0.016657274,-0.02660637,-0.012397786,-0.07020953,0.0482742,-0.039816957,-0.004737909,0.054200444,-0.007839927,-0.0027882159,-0.03664806,0.017542096,0.0017927919,-0.019373469,0.05276004,0.016749872,0.053459663,-0.017161416,0.019157408,-0.011595273,-0.00245898,-0.013601555,-0.036462866,0.005334649,-0.02376671,-6.1410195e-05,0.005036279,-0.042224493,-0.026770987,-0.020453775,6.9890266e-05,-0.006538417,0.03138029,0.00047970685,-0.03337628,0.010010826,-0.018375473,0.014506953,-0.028231971,0.0436649,0.0178096,-0.0073512183,-0.016873335,-0.038273662,0.033726092,0.0077164643,0.014589262,-0.06543562,0.0038325107,-0.03726538,0.0077884845,0.04053716,-0.047821503,0.013344339,-0.03286185,-0.009023119,-0.07576539,-0.012603559,0.06424214,0.005350