            ['id' => 17, 'context' => 'faq', 'content' => 'Melyik felszerelés hasznos egyedül edző játékosoknak vagy gyerekeknek? A Ball Mastery Starter Kit egy edzőpartner nélküli gyakorlást segítő készlet, amely rugalmas kötéllel rögzíti a labdát a játékoshoz, így az minden érintés után visszapattan. A csomag 30 edzésvideót tartalmaz, 3 nehézségi szinten (kezdő, haladó, profi), így gyerekek és kezdő játékosok is fokozatosan fejlődhetnek. Otthoni, pályaszéli és utánpótlás edzésekhez is ideális.', 'embedding' => '[-0.0054148636,0.0546444,-0.001019074,-0.0067589395,0.0016401582,-0.013121266,0.04038838,0.043803655,0.09192598,0.0020326395,0.024083197,-0.023973027,-0.018618757,-0.045918923,0.06359021,0.021284875,-0.022871325,-0.005467194,0.004902572,0.0066157184,0.045103665,0.00797632,0.014597546,-0.040366348,0.043296874,-0.025008626,0.06596989,-0.01842045,-0.01997385,-0.021031484,-0.018993335,-0.0060483417,-0.016150946,-0.05235286,-0.0047868933,-7.714063e-06,-0.0124932965,0.02133996,0.0199408,-0.026044225,0.0016401582,-0.00594368,-0.043473147,-0.0074585197,-0.016966205,0.008813613,0.026088294,-0.01808994,-0.011545833,0.044729084,-0.0037127344,0.09580397,-0.023267938,0.04799012,0.026925588,0.023642516,-0.008367424,0.03338156,-0.01887215,0.04847487,-0.018585706,0.02196793,-0.0065000392,0.013429742,-0.0026041472,0.013826355,-0.058478322,0.04988505,-0.009028445,0.06420717,0.0145644955,-0.027939152,-0.012548381,-0.045698583,-0.0136611,0.040542617,-0.019356897,-0.031067986,0.028512038,0.0546444,0.011523799,-0.006995805,0.03126629,0.021835726,-0.055173215,-0.02130691,0.022364542,0.009750059,0.0378765,-0.0031673922,-0.041534152,-0.0630614,-0.021350978,0.041071437,0.050898615,0.031398498,0.026528975,-0.046976555,0.0060483417,0.0018894182,-0.0028093392,-0.008598781,0.048871484,0.01251533,0.027630676,-0.020590803,-0.046579942,0.054732535,0.0005629007,0.023730652,0.0065881754,0.0076733516,0.01078015,-0.01458653,0.042107034,-0.03027476,0.025206933,-0.0059602056,0.0068691093,-0.0675